import { useEffect, useState } from "react";
import "./App.css";

function App() {
  const pokemons = [
    "Pikachu",
    "Charizard",
    "Bulbasaur",
    "Squirtle",
    "Jigglypuff",
    "Gengar",
    "Mewtwo",
    "Eevee",
    "Snorlax",
    "Lucario",
  ];

  function useFetchPokemon(pokemons) {
    const [pokeList, setPokeList] = useState([]);

    useEffect(() => {
      const list = pokemons.map((pokemon) => {
        fetch(`https://pokeapi.co/api/v2/pokemon/${pokemon.toLowerCase()}`);
      });

      Promise.all(list)
        .then((res) => res.json())
        .then((data) => console.log(data));
    }, [pokemons]);
  }

  useFetchPokemon(pokemons);
  return <h1>Hello! my guy</h1>;
}

export default App;
